import React from 'react'
import { Game } from '../../GameForm/Alies'


const FetchGameData = async (setGameData:React.Dispatch<React.SetStateAction<Game | undefined>>) => {
    await fetch("http://localhost:9091/games/latest", {method: 'GET'})
            .then(res => res.json())
            .then(async data => {
                setGameData(data["Value"])
                console.log(data["Value"])
            })

    return null
}

export default FetchGameData
